window.onload=()=>{enableEmojiCopy()};function enableEmojiCopy(){document.getElementById("results")?.querySelectorAll("tbody > tr > td:nth-child(2)").forEach(a=>a.onclick=()=>navigator.clipboard.writeText(a.textContent).then(()=>{let b=document.getElementById("toast");b.querySelector("#toast-body").innerHTML=`Emoji ${a.textContent} successfully copied!`,new bootstrap.Toast(b).show()},a=>console.error("Async: Could not copy text: ",a)))}